import React, { useEffect, useState } from "react";
import "./apiCss.css";

const ApiPage = () => {
    const [users, setUsers] = useState([]);

    const fetchUserData = () => {
        fetch("https://api.coincap.io/v2/assets")
            .then(response => response.json())
            .then(data => {
                setUsers(data.data); // Update here to set 'data.data' to the 'users' state
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    };

    useEffect(() => {
        fetchUserData();
    }, []);

    return (
        <div>
            {users.length > 0 && (
               <strong> <ul className="list">
                    {users.map(user => (
                        <li key={user.id}>
                            {user.name}
                            <ul>
                                <li className="list">Price: {user.priceUsd}</li>
                            </ul>
                        </li>
                    ))}
                </ul>
                </strong>
            )}
        </div>
    );
}

export default ApiPage;
